Static variables are those variables that retain their values between different function calls. Static variables are initialized only once at compile time and they have internal linkage. Static variables can be either global or local.
Register variables are those variables that are stored in a register instead of RAM. The register keyword is used to declare a register variable. The compiler may not store the variable in a register, it may choose to store it in RAM if a register is not available. Register variables have no linkage and they are used to increase the execution speed of a program.
